export default {
  model:
    "",
  modelInputs: [
    {
      id: "sepal-length",
      val: null,
      name: "Sepal Length (cm)",
      inputType: "number",
    },
    {
      id: "sepal-width",
      val: null,
      name: "Sepal Width (cm)",
      inputType: "number",
    },
    {
      id: "petal-length",
      val: null,
      name: "Petal Length (cm)",
      inputType: "number",
    },
    {
      id: "petal-width",
      val: null,
      name: "Petal Width (cm)",
      inputType: "number",
    },
  ],
  packages: ["scikit-learn"],
  imports: `
    import base64
    import pickle
    from sklearn.svm import SVC
    `,
  async executePython(model, paramList) {
    let res = window.pyodide.runPythonAsync(`
          model_encoded = b'${model}'
          model_obj = pickle.loads(base64.b64decode(model_encoded))
          model = model_obj['model']
          classes = model_obj['classes']
          params = ${paramList}
          x = model.predict([params]).tolist()[0]
          classes[x]
        `);
    return res;
  },
};
